import React from 'react'

const MoreInfo = ({moreInfoResult}) => {
    const infoList = MoreInfoResult.map(nutrient => {
        return <p>{nutrient.title}: {nutrient.id}</p>
    })

    return (
        <div class="more-info-container">
            {infoList}
        </div>
    )
}

export default MoreInfo
